import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={{ textAlign: 'center', marginTop: '2rem' }}>
      <h1>Welcome to the Clothing Store</h1>
      <div style={{ marginTop: '1rem' }}>
        <Link to="/category/mens">Men's Clothing</Link><br />
        <Link to="/category/womens">Women's Clothing</Link><br />
        <Link to="/category/kids">Kids' Clothing</Link>
      </div>
    </div>
  );
}

export default Home;
